import { createMuiTheme } from '@material-ui/core/styles/createMuiTheme';


const theme = createMuiTheme({
  typography: {
    fontFamily: 'Open Sans',
    fontSize: 30,
  },
  palette: {
    primary: {
      main: '#F7F3F2',
    },
    secondary: {
      main: '#5B9279',
    }
  }
});
export default theme
